import React from 'react';

const Header = () => {
    return (
        <header>
            <nav>
                <link tohref="/">Home</link>
                <br />
                <link href="/tipo-eventos">Tipo Eventos</link>
                <br />
                <link href="/eventos">Eventos</link>
                <br />
                <link href="/login">Login</link>
            </nav>
        </header>
    );
};

export default Header;
